// ==UserScript==
// @name         Show Reddit Post Info
// @namespace    http://tampermonkey.net/
// @version      2024-08-26
// @description  Show additional post info
// @author       Kant8
// @match        https://www.reddit.com/
// @match        https://reddit.com/
// @run-at       document-end
// @icon         https://www.google.com/s2/favicons?sz=64&domain=reddit.com
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    let creditsSlots = document.querySelectorAll('div[slot="credit-bar"]');
    for (let creditsNode of creditsSlots)
    {
        fixPost(creditsNode);
    }

    let feedNode = document.querySelector("shreddit-feed");
    const observerConfig = { childList: true };
    const feedCallback = (mutations, observer) => {
        for (let mutation of mutations)
        {
            for (let articleNode of mutation.addedNodes)
            {
                if (articleNode.localName != "article") {
                    continue;
                }

                let creditsNode = articleNode.querySelector('div[slot="credit-bar"]');
                fixPost(creditsNode);
            }
        }
    };

    let feedObserver = new MutationObserver(feedCallback);
    feedObserver.observe(feedNode, observerConfig);

    function fixPost(creditsNode)
    {
        let postNode = creditsNode.parentElement;
        let author = postNode.getAttribute("author");
        let link = postNode.getAttribute("content-href");
        let timeNode = creditsNode.children[0].querySelector("faceplate-timeago");

        let authorNode = document.createElement("span");
        authorNode.innerText = " by " + author;
        authorNode.className = "inline-block my-0 text-neutral-content-weak whitespace-nowrap";
        timeNode.after(authorNode);

        let linkNode = document.createElement("a");
        linkNode.href = link;
        linkNode.innerText = link;
        linkNode.className = "no-underline truncate ml-2xs max-w-fit";
        authorNode.after(linkNode);
    }
})();

#include <stdio.h>
#include <string.h>

// Define buffer size
#define BUFFER_SIZE 32

// Function to safely copy strings with buffer overflow protection
void safeStringCopy(char *dest, const char *src, size_t size) {
    if (strlen(src) >= size) {
        printf("Error: Input string is too large!\n");
        return;
    }
    strncpy(dest, src, size - 1);
    dest[size - 1] = '\0';  // Ensure null termination
}

int main() {
    // Example buffer
    char buffer[BUFFER_SIZE];

    // User input simulation
    const char *userInput = "Hello, World!";

    // Perform safe string copy
    safeStringCopy(buffer, userInput, BUFFER_SIZE);

    // Print the copied string
    printf("%s\n", buffer);

    return 0;
}
